INSERT INTO `s_reminder` VALUES (1, 'End Contract', 'select \'\', \'End Contract\' as tipe, employee_id, nip, name, endcontract as enddate, division_id, workarea_id,position_id, grade_id, employeestatus_id\r\nfrom m_employee\r\nwhere   endcontract >=curdate() and endcontract <=date_add(curdate(), interval 1 month)  and status=\'Active\'', 1);
INSERT INTO `s_reminder` VALUES (3, 'End Probation', 'select  \'\', \'End Probation\' as tipe, employee_id, nip, name, endprobationdate as enddate, division_id, workarea_id,position_id, grade_id, employeestatus_id\r\nfrom m_employee\r\nwhere   endprobationdate >=curdate() and endprobationdate <=date_add(curdate(), interval 1 month)  and status=\'Active\'', 1);
INSERT INTO `s_reminder` VALUES (4, 'End Punishment', 'select \'\',  \'End Punishment\' as tipe, ep.employee_id, e.nip, e.name, ep.validthrough as enddate, e.division_id, e.workarea_id, e.position_id, e.grade_id, e.employeestatus_id\r\nfrom m_employee_punishment ep \r\nleft join m_employee e on e.employee_id = ep.employee_id\r\nwhere   validthrough >=curdate() and validthrough <=date_add(curdate(), interval 1 month) and status=\'Active\'', 1);
INSERT INTO `s_reminder` VALUES (5, 'Birthday', 'select \'\', \'Birthday\' as tipe, employee_id, nip, name, dob as enddate, division_id, workarea_id,position_id, grade_id, employeestatus_id\r\nfrom m_employee\r\nwhere   day(dob) >= day(curdate()) and month(dob) = month(curdate()) and status=\'Active\'', 1);
INSERT INTO `s_report` VALUES (11, 'Penawaran', 'select p.penawaran_id, p.company_id, date_format(p.tdate, %Y-%m-%d) as date, p.tdate, p.company_tujuan, p.name_tujuan, p.telp_tujuan, p.name_asal, p.telp_asal, p.grandtotal , c.name as companyname, c.address, c.telp, c.fax, if(p.tempo > 0, concat( ( Tempo , p.tempo,  Hari )),   ) as tempo from t_penawaran p left join m_company c on p.company_id = c.company_id where p.tdate >=2015-03-03 and p.tdate<=2015-03-03  order by p.tdate, p.name_tujuan \r\n', ' order by p.tdate, p.name_tujuan', NULL, NULL);
INSERT INTO `s_report` VALUES (12, 'Surat Jalan', 'select s.sj_id, s.nosj, date_format(s.tdate, %Y-%m-%d) as date, s.tdate, s.customer_id, c.name as customername, co.name as companyname, s.kendaraan, c.address, c.pic, c.telp from t_suratjalan s left join m_customer c on s.customer_id = c.customer_id cross join m_company co where s.print=0 and s.tdate >=2015-03-01 and s.tdate<=2015-03-31  order by s.tdate, s.nosj \r\n', ' order by s.tdate, s.nosj', NULL, NULL);
INSERT INTO `s_report` VALUES (13, 'Faktur', 'select f.faktur_id, f.nofaktur, f.sj_id, date_format(f.tdate, %Y-%m-%d) as tgl, date_format(f.tdate1, %Y-%m-%d) as Tgl_JatuhTempo, s.nosj, f.grandtotal, s.customer_id, c.name as customername, co.name as companyname, f.tdate, f.tdate1, c.address, co.norek, co.bank, co.atasnama, co.cabang,  if(pesanpembayaran = 0, null, concat( Pembayaran Paling Lambat , datediff( f.tdate1, f.tdate),   Hari, Tgl : , gettgl(f.tdate1)) ) as pesanpembayaran,  if(rekening = 0, null, concat(co.bank,  : , co.norek, , a/n , co.atasnama ) ) as rekening, f.jasapotong, f.jasaongkir from t_faktur f left join t_suratjalan s on f.sj_id = s.sj_id left join m_customer c on s.customer_id = c.customer_id cross join m_company co where f.print=0 and f.tdate >=2015-03-09 and f.tdate<=2015-03-09 order by f.nofaktur\r\n', ' order by f.tdate, f.nofaktur', NULL, NULL);
INSERT INTO `s_report` VALUES (14, 'Sertifikat', 'select sertifikat_id, name, file from m_sertifikat  order by name \r\n', ' order by name', NULL, NULL);
INSERT INTO `s_report` VALUES (15, 'Penawaran Detail', 'select * from t_penawaran_detail  order by penawaran_id, itemname, uom desc, size\r\n', ' order by penawaran_id, itemname, uom desc, size', NULL, 'Rekap Detail Pengambilan Barang');
INSERT INTO `s_report` VALUES (16, 'Surat Jalan Carbon Steel', 'select s.sj2_id as sj_id, s.nosj2 as nosj, date_format(s.tdate, %Y-%m-%d) as date, s.tdate, s.customer_id, c.name as customername, co.name as companyname, s.kendaraan, c.address, c.pic, c.telp from t_suratjalan2 s left join m_customer c on s.customer_id = c.customer_id cross join m_company co where s.print=0 and s.tdate >=2015-03-20 and s.tdate<=2015-03-20  order by s.tdate, s.nosj2 \r\n', ' order by s.tdate, s.nosj2', NULL, NULL);
INSERT INTO `s_report` VALUES (17, 'query v_payroll_detail', 'select pd.payroll_id AS payroll_id, ph.tdate AS tdate, s.columndb AS columndb, \r\nsum(pd.amount) AS amount\r\nfrom t_payroll_detail pd \r\nleft join m_salary s on pd.salary_id=s.salary_id\r\nleft join t_payroll ph on ph.payroll_id=pd.payroll_id\r\nwhere s.summaryorder >= 1 and isnull(s.columndb)=false\r\nand $filtertgl\r\ngroup by pd.payroll_id, ph.tdate, s.columndb', '', NULL, NULL);
