-- ----------------------------
-- Function structure for 0_getbaselembur
-- ----------------------------
DROP FUNCTION IF EXISTS `0_getbaselembur`;
delimiter ;;
CREATE FUNCTION `0_getbaselembur`(tipebase varchar(200), eid int, sdate date, edate date)
 RETURNS double
begin
  -- tipebase = hb4, hb8, lebaran4, lebaran8, bulanan, bulanan2
  declare divi, dept, lev, hkerja, isbulanan, isget, esid int;
  declare tipem varchar(200);
  declare gapok, hasil double;

  select division_id, department_id, level_id, harikerja, employeestatus_id
    into divi, dept, lev, hkerja, esid from m_employee where employee_id=eid;
  select `level` into tipem from m_level where level_id=lev;  

  set hasil = 0;
  -- tipebase = hb4, hb8, lebaran4, lebaran8, bulanan, bulanan2
  set gapok = 0;
  set isbulanan = 0;

  set isget=0;
  if dept=0 THEN
	set isget=0;
  ELSE
	select islembur into isget from m_department where department_id=dept;			
  end if;

  if isget=1 then
    if tipebase='harian4' then
	  if esid=10 then
		select `value` into gapok from s_setting 
		where name='Mitra HB 4 Jam';
	  else 
	    select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
	    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (378) group by employee_id;
	  end if;
	  set isbulanan = 0;
	  set hkerja= 1;
    elseif tipebase='harian8' then
	  if esid=10 then
		select `value` into gapok from s_setting 
		where name='Mitra HB 8 Jam';
	  else
        select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
        where employee_id = eid and tdate <= edate and active = 1 and salary_id in (352) group by employee_id;
	  end if;
      set isbulanan = 0;
	  set hkerja= 1;
    elseif tipebase='bulanan4' then
	  if esid=10 then
		select `value` into gapok from s_setting 
		where name='Mitra HB 4 Jam';
	  else 
	    select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
	    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (378) group by employee_id;
	  end if;
      set isbulanan = 1;
	  set hkerja= 1;
    elseif tipebase='bulanan8' then
      if esid=10 then
		select `value` into gapok from s_setting 
		where name='Mitra HB 8 Jam';
	  else
        select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
        where employee_id = eid and tdate <= edate and active = 1 and salary_id in (352) group by employee_id;
	  end if;
	  set isbulanan = 1;
	  set hkerja= 1;  
    end if;
  end if;

  if isget=1 then
    if isbulanan=1 then
	  if gapok=0 THEN
	    select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
		where employee_id = eid and tdate <= edate and active = 1 and salary_id in (1,2,3,4) group by employee_id;
	  else 
		set gapok = 0;
	  end if;

	  if divi=13 or divi=10 or divi=4 or divi=6 or divi=11 or divi=5 or divi=9 or divi=15 or divi=8 then
	    set hkerja=22;
      else
	    set hkerja=25;
      end if;
    end if;
  end if;

  set hasil = (gapok/hkerja) * isget;
  
  if tipem = 'Manager' then
	set hasil = 0;
  end if;

  return hasil;
end
;;
delimiter ;

-- ----------------------------
-- Function structure for 0_gettotallembur
-- ----------------------------
DROP FUNCTION IF EXISTS `0_gettotallembur`;
delimiter ;;
CREATE FUNCTION `0_gettotallembur`(tipelembur varchar(200), eid int, sdate date, edate date)
 RETURNS double
begin
  declare hasil double;
  
  -- libur4, libur, 
  -- libur3_4, libur3,
  set hasil = 0;

  -- tipelembur= = hb4, hb8, lebaran4, lebaran8
  if tipelembur='hb4' then
    select sum(libur4) into hasil from t_rekap
    where employee_id=eid and tdate between sdate and edate
    group by employee_id;
  elseif tipelembur='hb8' then
	select sum(libur) into hasil from t_rekap
    where employee_id=eid and tdate between sdate and edate
    group by employee_id;
  elseif tipelembur='lebaran4' then
	select sum(libur3_4) into hasil from t_rekap
    where employee_id=eid and tdate between sdate and edate
    group by employee_id;
  elseif tipelembur='lebaran8' then
	select sum(libur3) into hasil from t_rekap
    where employee_id=eid and tdate between sdate and edate
    group by employee_id;
  end if;
  
  return hasil;
end
;;
delimiter ;

-- ----------------------------
-- Function structure for 1_getbaselembur_copy
-- ----------------------------
DROP FUNCTION IF EXISTS `1_getbaselembur_copy`;
delimiter ;;
CREATE FUNCTION `1_getbaselembur_copy`(tipebase varchar(200), eid int, sdate date, edate date)
 RETURNS double
begin
  -- tipebase = hb4, hb8, lebaran4, lebaran8, bulanan, bulanan2
  declare divi, dept, lev, hkerja, isget int;
  declare tipem varchar(200);
  declare gapok, hasil double;

  select division_id, department_id, level_id, harikerja into divi, dept, lev, hkerja from m_employee where employee_id=eid;
  select `level` into tipem from m_level where level_id=lev;  

  set hasil = 0;
  -- tipebase = hb4, hb8, lebaran4, lebaran8, bulanan, bulanan2
  set gapok = 0;
  if tipebase='hb4' then
	select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (378) group by employee_id;
	set hkerja= 1;
  elseif tipebase='hb8' then
    select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (352) group by employee_id;
	set hkerja= 1;
  elseif tipebase='lebaran4' then
	select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (378) group by employee_id;
    set gapok = gapok * 2;
	set hkerja= 1;
  elseif tipebase='lebaran8' then
    select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (352) group by employee_id;
	set gapok = gapok * 2;
	set hkerja= 1;
  elseif tipebase='bulanan' or tipebase='bulanan2' then
	select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
    where employee_id = eid and tdate <= edate and active = 1 and salary_id in (352) group by employee_id;
	if gapok=0 THEN
	  select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
      where employee_id = eid and tdate <= edate and active = 1 and salary_id in (378) group by employee_id;
	  if gapok=0 then
		select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
		where employee_id = eid and tdate <= edate and active = 1 and salary_id in (1,2,3,4) group by employee_id;
	  ELSE
		set gapok = gapok * 2;
	  end if;
	end if;
	
	if tipebase='bulanan2' then
	  set gapok = gapok * 2;
	end if;

	if divi=13 or divi=10 or divi=4 or divi=6 or divi=11 or divi=5 or divi=9 or divi=15 or divi=8 then
	  set hkerja=22;
    else
	  set hkerja=25;
    end if;
  
  end if;

  set isget=0;
  if dept=0 THEN
	set isget=0;
  ELSE
	select islembur into isget from m_department where department_id=dept;			
  end if;

  set hasil = (gapok/hkerja) * isget;
  
  if tipem = 'Manager' then
	set hasil = 0;
  end if;

  return hasil;
end
;;
delimiter ;

-- ----------------------------
