DROP PROCEDURE IF EXISTS `ad01_upm`;
delimiter ;;
CREATE PROCEDURE `ad01_upm`(sdate date, edate date)
begin	
-- UPM
-- minimal 4 jam kerja
-- jika ada OT di hari sabtu dan minggu
-- 12000 perhari
-- 

	update t_attendance
	set upm=0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011'
	and (0=0);	
	
	update t_attendance
	set 
		upm=12000
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and workhour>=4 and dayofweek(tdate) in (1,7) and overtimehour>0;
	
end
;;
delimiter ;

