-- ----------------------------
-- Function structure for getabsen
-- ----------------------------
DROP FUNCTION IF EXISTS `getabsen`;
delimiter ;;
CREATE FUNCTION `getabsen`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare hasil, thadir double;
  declare did, hkerja int;
  declare ispro, lid int;
  declare tipem varchar(200);

  set ispro = isprorate(eid, sdate, edate);

  if (ispro=1) then
    set hasil = 0;
  else
	  set hkerja=0;
	  select level_id, department_id, harikerja into lid, did, hkerja from m_employee where employee_id=eid;
	  select `level` into tipem from m_level where level_id=lid;

	  -- select department_id into did from m_employee where employee_id = eid;
	  if did=0 THEN
		set hkerja=25;
	  ELSE
		-- select harikerja into hkerja from m_employee where employee_id = eid;
		if (hkerja=0) THEN
		  select harikerja into hkerja from m_department where department_id=did;
		end if;
	  end if;

	  select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into thadir from m_employee_salary
	  where employee_id = eid and tdate <= edate and active = 1 and salary_id in (5) group by employee_id;

	  if tipem = 'Manager' or eid=2886  then
		select sum(alpa) into hasil from t_rekap
		where employee_id=eid and tdate between sdate and edate
		group by employee_id;
	  else
		select sum(alpa+sakit2+izin) into hasil from t_rekap
		where employee_id=eid and tdate between sdate and edate
		group by employee_id;
	  end if;

	  if thadir <>0 THEN
		set hasil = hasil - 2;
	  end if;

	  if hasil <= 0 then
		set hasil = 0;
	  end if;

	  set hasil = hasil / hkerja;
  end if;


  return hasil;
end
;;
delimiter ;

-- ----------------------------
-- Function structure for gethadir
-- ----------------------------
DROP FUNCTION IF EXISTS `gethadir`;
delimiter ;;
CREATE FUNCTION `gethadir`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare gapok, hasil double;
  declare lid int;
  
  declare x int;

	select level_id into lid from m_employee where employee_id=eid;
  
  select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
  where employee_id = eid and tdate <= edate and active = 1 and salary_id in (5) group by employee_id;

	if (lid=10) or (lid=11) or (lid=12) or (lid=13) or (lid=14) or (lid=21) or (lid=22) THEN
			select sum(alpa) into x from t_rekap
			where employee_id=eid and tdate between sdate and edate
			group by employee_id;
  else
			select sum(sakit2+izin+alpa) into x from t_rekap
			where employee_id=eid and tdate between sdate and edate
			group by employee_id;
  end if;

  set hasil =0;
  if x = 1 then
		set hasil = gapok * (50/100);
  elseif x >= 2 then
		set hasil = 0;
  elseif x <= 0 then
		set hasil = gapok;
  end if; 

  return hasil;
end
;;
delimiter ;

