-- ----------------------------
-- Function structure for getloan
-- ----------------------------
DROP FUNCTION IF EXISTS `getloan`;
delimiter ;;
CREATE FUNCTION `getloan`(eid int, sdate date, edate date, vtipe varchar(255))
 RETURNS double
begin
	declare hasil double;
	declare rdate date;
	declare isresign int;

	select resigndate into rdate from m_employee where employee_id = eid;
	set hasil = 0;
	set isresign = 0;
	if not isnull(rdate) then	
		if (rdate >= sdate) and (rdate <= edate)  then /*ini kalo resigndate diantara tgl payroll*/
			set isresign = 1;
		end if;
	end if;

	if isresign=0 then
		select sum(b.amount) into hasil
		from t_loan a
		left join t_loan_detail b on a.loan_id=b.loan_id
		where a.employee_id=eid and b.tdate >= sdate and b.tdate <= edate and a.tipe=vtipe
		group by a.employee_id;

		update t_loan_detail set payrolldate=edate
		where loan_id in ( select loan_id from t_loan where employee_id=eid and tipe= vtipe )
		and tdate >= sdate and tdate <= edate;
	else
		select sum(b.amount) into hasil
		from t_loan a
		left join t_loan_detail b on a.loan_id=b.loan_id
		where a.employee_id=eid and b.payrolldate is null and a.tipe=vtipe
		group by a.employee_id;

		update t_loan_detail set payrolldate=edate
		where loan_id in ( select loan_id from t_loan where employee_id=eid and tipe=vtipe)
		and payrolldate is null;
	end if;

	update t_loan a, (
		select loan_id, sum(amount) as sudahbayar
		from t_loan_detail
		where payrolldate is not null and loan_id in ( select loan_id from t_loan where employee_id=eid )
		group by loan_id ) b
	set a.sudahbayar=b.sudahbayar
	where a.loan_id=b.loan_id and employee_id=eid and a.tipe=vtipe;

	update t_loan set sisa=total-sudahbayar where employee_id=eid and tipe=vtipe;

	return hasil;
end
;;
delimiter ;

-- ----------------------------
-- Function structure for getmakan
-- ----------------------------
DROP FUNCTION IF EXISTS `getmakan`;
delimiter ;;
CREATE FUNCTION `getmakan`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare hasil double;
  declare did, hkerja int;
  
  select department_id into did from m_employee where employee_id = eid;
  if did=0 THEN
		set hkerja=26;
  ELSE		
		select harikerja into hkerja from m_employee where employee_id = eid;
		if (hkerja=0) THEN
			select harikerja into hkerja from m_department where department_id=did;
		end if;
  end if;

  select sum(masuk) into hasil from t_rekap
  where employee_id=eid and tdate between sdate and edate
  group by employee_id;

  set hasil = hasil / hkerja;
  if hasil>= 1 THEN
		set hasil=1; 
  end if;
  /*set hasil=1;*/
  return hasil;
end
;;
delimiter ;

-- ----------------------------
-- Function structure for getmasakerja
-- ----------------------------
DROP FUNCTION IF EXISTS `getmasakerja`;
delimiter ;;
CREATE FUNCTION `getmasakerja`(eid int, sdate date, edate date)
 RETURNS double
begin
	declare lv, masakerja, hasil double;
    declare tipe varchar(200);
    declare pid int;
	declare isget int;
	declare divi int;

	update m_employee set age= hitungAge(edate, dob), worklength=hitungAge(edate, joindate), worklengthpermanent= hitungAge(edate, permanentdate) ;

	set hasil = 0;
    set masakerja = 0;

	select worklength, position_id, level_id, division_id into masakerja, pid, lv, divi
    from m_employee where employee_id=eid and nip not in ('13030014','13030030','13110055','14090017','16050024','13030009');

	select lower(`level`) into tipe from m_level where level_id=lv;

	select ismasakerja into isget from m_division where division_id=divi;

	-- 57 rm, 58 rspv;
	if pid=57 or pid=58 then
		select amount into hasil from m_masakerja2 where masakerja>= dari and masakerja<sampai;
	else 
		select amount into hasil from m_masakerja where masakerja>= dari and masakerja<sampai;
	end if;
	
	set hasil = round(hasil, 0) * isget;

	if tipe='manager' then 
		set hasil = 0;	
	end if;
	
	return hasil;
end
;;
