DROP FUNCTION IF EXISTS `getmasakerja_copy`;
delimiter ;;
CREATE FUNCTION `getmasakerja_copy`(eid int, sdate date, edate date)
 RETURNS double
begin
	declare lv, masakerja, hasil double;
    declare tipe varchar(200);
	update m_employee set age= hitungAge(edate, dob), worklength=hitungAge(edate, joindate), worklengthpermanent= hitungAge(edate, permanentdate) ;
	set hasil = 0;
    set masakerja = 0;
	select worklength into masakerja from m_employee where employee_id=eid and nip not in ('13030014','13030030','13110055','14090017','16050024','13030009');
	select level_id into lv from m_employee where employee_id=eid;
	select lower(`level`) into tipe from m_level where level_id=lv;
	select amount into hasil from m_masakerja where masakerja>= dari and masakerja<sampai;
	set hasil = round(hasil, 0);
	if tipe='manager' then 
		set hasil = 0;	
	end if;
	return hasil;
end
;;
