-- ----------------------------
-- Function structure for getmasuk
-- ----------------------------
DROP FUNCTION IF EXISTS `getmasuk`;
delimiter ;;
CREATE FUNCTION `getmasuk`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare hasil double;
  declare did, hkerja int;
  
  select department_id into did from m_employee where employee_id = eid;
  if did=0 THEN
		set hkerja=25;
  ELSE
		select harikerja into hkerja from m_employee where employee_id = eid;
		if (hkerja=0) THEN
			select harikerja into hkerja from m_department where department_id=did;
		end if;
  end if;

  select sum(masuk+sakit+cuti) into hasil from t_rekap
  where employee_id=eid and tdate between sdate and edate
  group by employee_id;

  set hasil = hasil / hkerja;
  if hasil>= 1 THEN
		set hasil=1; 
  end if;
  /*set hasil=1;*/
  return hasil;
end
;;
delimiter ;

-- ----------------------------
