DROP FUNCTION IF EXISTS `getproporsional`;
delimiter ;;
CREATE FUNCTION `getproporsional`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare hasil double;
  declare d1, m1, y1, d2, m2, y2 int;
  declare jdate, rdate date;
  declare bln varchar(20);

  set hasil = datediff(edate, sdate)+1;
  set d1 = day(sdate);
  set m1 = month(sdate);
  set y1 = year(sdate);
  set d2 = day(edate);
  set m2 = month(edate);
  set y2 = year(edate);

  select joindate, resigndate into jdate, rdate from m_employee where employee_id = eid;
  set hasil = 1;
  if isnull(rdate) then
	if (jdate > sdate) and (jdate <= edate) then
  		set hasil = datediff(edate, jdate) + 1; /*kalo joindate diantara tgl payroll resigndate kosong*/
		set hasil = getmasuk(eid, sdate, edate);
	end if;
  else
	if (jdate > sdate) and (jdate <= edate) then
		if (rdate >= sdate) and (rdate <= edate)  then
			set hasil = datediff(rdate, jdate) + 1; /*ini kalo joindate dan resigndate diantara tgl payroll*/
			set hasil = getmasuk(eid, sdate, edate);
		end if;
	else
		if (rdate >= sdate) and (rdate < edate)  then
			set hasil = datediff(rdate, sdate) + 1; /*ini kalo resigndate diantara tgl payroll*/
			set hasil = getmasuk(eid, sdate, edate);
			/*set hasil = 3;*/
		end if;
	end if;
  end if;

  /*set hasil = hasil / ( datediff(edate, sdate)+1 );*/
	if hasil >= 1 then
		set hasil=1;
	end if;
/*  set hasil = round(hasil, 2);*/

	return 1;
--   return hasil;
end
;;
