-- ----------------------------
-- Function structure for getTgl
-- ----------------------------
DROP FUNCTION IF EXISTS `getTgl`;
delimiter ;;
CREATE FUNCTION `getTgl`(dt date)
 RETURNS varchar(200) CHARSET latin1 COLLATE latin1_swedish_ci
begin
  declare d, m, y int;
  declare bln varchar(20);
  set d = day(dt);
  set m = month(dt);
  set y = year(dt);
  if m=1 then set bln  ='Januari'; 
  elseif m=2 then set bln ='Februari';
  elseif m=3 then set bln ='Maret';
  elseif m=4 then set bln = 'April';
  elseif m=5 then set bln ='Mei';
  elseif m=6 then set bln = 'Juni';
  elseif m=7 then set bln = 'Juli';
  elseif m=8 then set bln = 'Agustus';
  elseif m=9 then set bln = 'September';
  elseif m=10 then set bln = 'Oktober';
  elseif m=11 then set bln = 'November'; 
  elseif m=12 then set bln = 'Desember'; 
end if;

  return concat( d, '-', bln, '-', y) ;
end
;;
delimiter ;

