DROP FUNCTION IF EXISTS `getuangcuti`;
delimiter ;;
CREATE FUNCTION `getuangcuti`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare base, hasil double;
  declare hari, wid, bagi int;

  select round(  coalesce(sum(m_employee_salary.amount ),0), 0) into base from m_employee_salary
  where employee_id = eid and tdate <= edate and active = 1 and salary_id in (
	select salary_id from m_salary where name in (select name from m_sisacuti)
  ) 
  group by employee_id;

 
  select sisacuti into hari
  from t_sisacuti where employee_id=eid and tdate>=sdate and tdate<=edate;
  
  select workarea_id into wid from m_employee where employee_id=eid;
  
  select pembagi into bagi from m_workarea where workarea_id=wid;

  set hasil = 0;
  /*hanya untuk headoffice*/
  /*if wid = 15 then*/
    if bagi > 0 then
      set hasil = round( (hari/bagi) * base, 0);
    end if;
  /*end if;*/

  return hasil;
end
;;
