-- ----------------------------
-- Function structure for hitungtransport
-- ----------------------------
DROP FUNCTION IF EXISTS `hitungtransport`;
delimiter ;;
CREATE FUNCTION `hitungtransport`(eid int, sid int, tipe varchar(10), sdate date, edate date)
 RETURNS double
begin
  declare jml int default 0;
  declare potongan int default 0;
  declare transport int default 0;
  declare jadi double default 0;

  select count(*) into jml
  from t_attendance where tdate>=sdate and tdate<=edate and employee_id=eid
  and statusattendance in ('Late','Forget Absent')
  group by employee_id;

  select amount into potongan
  from m_potongantransport
  where jumlah = jml;

  if tipe='t_ad' then
	select coalesce( round( sum(t_ad.amount),0), 0)  as amount into transport from t_ad
	 where employee_id = eid and
	tdate >= sdate and
	tdate <=edate and salary_id = sid group by employee_id;
  else
	select coalesce(sum(m_employee_salary.amount ),0)  as amount into transport from m_employee_salary
	where employee_id = eid and tdate <= edate and salary_id = sid and active = 1 group by employee_id;
  end if;

  set jadi = transport - potongan;

  if jadi <= 0 then set jadi = 0; end if;
  return jadi;
end
;;
delimiter ;

