-- ----------------------------
-- Procedure structure for minutes01_workhour
-- ----------------------------
DROP PROCEDURE IF EXISTS `minutes01_workhour`;
delimiter ;;
CREATE PROCEDURE `minutes01_workhour`(sdate date, edate date)
begin
	update t_attendance
	set workhour=0
	where
	tdate>=sdate and tdate<=edate
	-- and nip='1001011'
	and (0=0);
	
  update t_attendance
	set workhour = 
		case when timeout < timein then 
			round( 
					TIMESTAMPDIFF( 
						minute, 
						concat(tdate, ' ', timein), 
						concat(DATE_ADD( tdate, interval 1 day), ' ', timeout)
					) / 60
				, 2
			)
		else
			round( 
					TIMESTAMPDIFF( 
						minute, 
						concat(tdate, ' ', timein), 
						concat(tdate, ' ', timeout)
					) / 60
				, 2 
			)
		end 
	where 
	tdate>=sdate and tdate<=edate
	-- and nip='1001011' 
	and ISNULL(timein)=FALSE and ISNULL(timeout)=FALSE 
	and timein<>'00:00:00'
	and timeout<>'00:00:00';
end
;;
delimiter ;

