					) / 60
				, 2 
			)
		end 
	where 
	tdate>=sdate and tdate<=edate
	-- and nip='1001011' 
	and ISNULL(timein)=FALSE and ISNULL(timeout)=FALSE 
	and timein<>'00:00:00'
	and timeout<>'00:00:00';
end
;;
