-- ----------------------------
-- Procedure structure for minutes05_overtimehour
-- ----------------------------
DROP PROCEDURE IF EXISTS `minutes05_overtimehour`;
delimiter ;;
CREATE PROCEDURE `minutes05_overtimehour`(sdate date, edate date)
begin	
	update t_attendance
	set overtimehour=0
	where
	tdate>=sdate and tdate<=edate
	-- and nip='1001011'
	and (0=0);
	
	update t_attendance
	set overtimehour=
		case when overtimeminutes mod 60 >= 30 then 
