-- ----------------------------
-- Procedure structure for minutes06_breaktime
-- ----------------------------
DROP PROCEDURE IF EXISTS `minutes06_breaktime`;
delimiter ;;
CREATE PROCEDURE `minutes06_breaktime`(sdate date, edate date)
begin	
-- 	update t_attendance
-- 	set overtimehour=0
-- 	where
-- 	a.tdate>=sdate and a.tdate<=edate 
-- 	and a.nip='1001011';	
	
	update t_attendance
	set overtimehour = overtimehour - (
		case when dayofweek(tdate)=7 then 
			case when concat(tdate, ' 12:00:01') >= concat(tdate, ' ', otin) and
								concat(tdate, ' 12:00:01') <= case when otout<otin then concat(date_add(tdate, interval 1 day), ' ', otout) else concat(tdate, ' ', otout) end
					 then 1 else 0 end
		else 
			case when ( concat(tdate, ' 12:00:01') >= concat(tdate, ' ', otin) and
								  concat(tdate, ' 12:00:01') <= case when otout<otin then concat(date_add(tdate, interval 1 day), ' ', otout) else concat(tdate, ' ', otout) end )
							or ( concat(tdate, ' 18:00:01') >= concat(tdate, ' ', otin) and
								  concat(tdate, ' 18:00:01') <= case when otout<otin then concat(date_add(tdate, interval 1 day), ' ', otout) else concat(tdate, ' ', otout) end )		
							or ( concat(date_add(tdate, interval 1 day), ' 04:00:01') >= concat(tdate, ' ', otin) and
								  concat(date_add(tdate, interval 1 day), ' 04:00:01') <= case when otout<otin then concat(date_add(tdate, interval 1 day), ' ', otout) else concat(tdate, ' ', otout) end )		
					 then 1 else 0 end
		end
	)		
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and ISNULL(otin)=FALSE and ISNULL(otout)=FALSE;
	
	update t_attendance set overtimehour = 0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and overtimehour<=0;
end
;;
delimiter ;

