-- ----------------------------
-- Procedure structure for minutes07_lateoutpermit
-- ----------------------------
DROP PROCEDURE IF EXISTS `minutes07_lateoutpermit`;
delimiter ;;
CREATE PROCEDURE `minutes07_lateoutpermit`(sdate date, edate date)
begin	
	update t_attendance
	set lateminutes=0, earlyoutminutes=0, permitminutes=0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011'
	and (0=0);	
	
	update t_attendance
	set lateminutes = 
		case when timein > shiftin then 
			TIMESTAMPDIFF( 
				minute, 
				concat(tdate, ' ', shiftin), 
				concat(tdate, ' ', timein)
			) 
		else 0 end	
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and ISNULL(timein)=FALSE and ISNULL(shiftin)=FALSE;
	
	update t_attendance
	set earlyoutminutes = 
		case when timeout < shiftout then 
			TIMESTAMPDIFF( 
				minute, 
				concat(tdate, ' ', timeout), 
				concat(tdate, ' ', shiftout)
			) 
		else 0 end	
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and ISNULL(timeout)=FALSE and ISNULL(shiftout)=FALSE;
	
	update t_attendance
	set permitminutes = TIMESTAMPDIFF( 
				minute, 
				concat(tdate, ' ', permitin), 
				concat(tdate, ' ', permitout)
			) 	
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and ISNULL(permitin)=FALSE and ISNULL(permitout)=FALSE;
end
;;
