-- ----------------------------
-- Procedure structure for ot01_othour
-- ----------------------------
DROP PROCEDURE IF EXISTS `ot01_othour`;
delimiter ;;
CREATE PROCEDURE `ot01_othour`(sdate date, edate date)
begin	
	update t_attendance
	set ot150=0, ot200=0, ot300=0, ot400=0, totalothour=0, totalothour2=0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011'
	and (0=0);
	
	update t_attendance
	set 
		ot150=(
			case when dayofweek(tdate)=1 or dayofweek(tdate)=7 then 0 else  
				case when overtimehour>=1 then 1.5 else 0 end
			end 
		),
		ot200=(
			case when dayofweek(tdate)=1 or dayofweek(tdate)=7 then 
				case when overtimehour>7 then 14 else overtimehour*2 end
			else  
				case 
					when overtimehour-1>7 then 14
					when overtimehour-1>1 and overtimehour-1<=7 then (overtimehour-1)*2
					else 0
				end
			end 
		),
		ot300=(
			case when dayofweek(tdate)=1 or dayofweek(tdate)=7 then 
				case when overtimehour-7>0 then (case when (overtimehour-7)*3>=3 then 3 else (overtimehour-7)*3 end) else 0 end
			else  
				case 
					when overtimehour-8>0 then (case when (overtimehour-8)*3>=3 then 3 else (overtimehour-8)*3 end)
					else 0
				end
			end 
		),
		ot400=(
			case when dayofweek(tdate)=1 or dayofweek(tdate)=7 then 
				case when overtimehour-8>0 then (overtimehour-8)*4 else 0 end
			else  
				case 
					when overtimehour-9>0 then (overtimehour-9)*4
					else 0
				end
			end 
		)
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and overtimehour>0;
	
	update t_attendance
	set totalothour2=0, totalothour=ot150+ot200+ot300+ot400
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011' 
	and overtimehour>0;
end
;;
delimiter ;

