-- ----------------------------
-- Procedure structure for ot02_baseot
-- ----------------------------
DROP PROCEDURE IF EXISTS `ot02_baseot`;
delimiter ;;
CREATE PROCEDURE `ot02_baseot`(sdate date, edate date)
begin	
	update t_attendance
	set baseot=0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011'
	and (0=0);
	
	update t_attendance a, m_overtime b
	set a.baseot = (
		case 
			when b.base='SALARY' then (
				select coalesce(sum(m_employee_salary.amount ),0) as baseot
        from m_employee_salary
        where employee_id=a.employee_id and tdate <= a.tdate
        and active = 1 and salary_id in ( 
					select salary_id from m_salary where tables='m_employee_salary' 
					and slipname in ( 
						select slipname from m_overtimebase where overtime_id=a.overtime_id 
					) 
        ) 
        group by employee_id						
			) 
			when b.base='FIX' then b.baseot
			when b.base='HOUR' then (select baseothour from m_overtimefixhour where overtime_id=a.overtime_id and overtimetype_id=a.overtimetype_id)
			else 0
		end
	)
	where
	a.tdate>=sdate and a.tdate<=edate 
	-- and a.nip='1001011'
	and (0=0);
end
;;
