-- ----------------------------
-- Procedure structure for ot03_totalotrp
-- ----------------------------
DROP PROCEDURE IF EXISTS `ot03_totalotrp`;
delimiter ;;
CREATE PROCEDURE `ot03_totalotrp`(sdate date, edate date)
begin	
  update t_attendance
	set totalotrp=0
	where
	tdate>=sdate and tdate<=edate 
	-- and nip='1001011'
	and (0=0);
	
	update t_attendance a, m_overtime b
	set a.totalotrp = (
		case 
			when b.base='SALARY' then round( (a.baseot/b.rate) * (a.totalothour+a.totalothour2), 0)
			when b.base='FIX' then round( (a.baseot/b.rate) * (a.totalothour+a.totalothour2), 0)
			when b.base='HOUR' then round( a.baseot*(a.totalothour+a.totalothour2), 0)
			else 0
		end
	)
	where
	a.tdate>=sdate and a.tdate<=edate 
	-- and a.nip='1001011'
	and (0=0);
	
end
;;
