-- ----------------------------
-- Function structure for pothadir
-- ----------------------------
DROP FUNCTION IF EXISTS `pothadir`;
delimiter ;;
CREATE FUNCTION `pothadir`(eid int, sdate date, edate date)
 RETURNS double
begin
  declare gapok, hasil double;
  declare lid int;
  declare ispro int;
  declare x int;
  declare tipem varchar(200);

  set ispro = isprorate(eid, sdate, edate);
  
  select level_id into lid from m_employee where employee_id=eid;
  select `level` into tipem from m_level where level_id=lid;

  select round( coalesce(sum(m_employee_salary.amount ),0), 0) as amount into gapok from m_employee_salary
  where employee_id = eid and tdate <= edate and active = 1 and salary_id in (5) group by employee_id;
		
  set gapok = gapok * getproporsional(eid, sdate, edate); 
  -- if (lid=10) or (lid=11) or (lid=12) or (lid=13) or (lid=14) or (lid=21) or (lid=22) THEN
  if tipem = 'Manager' or eid=2886  then
	select sum(alpa) into x from t_rekap
	where employee_id=eid and tdate between sdate and edate
	group by employee_id;
  else
   	select sum(sakit2+izin+alpa) into x from t_rekap
	where employee_id=eid and tdate between sdate and edate
	group by employee_id;
  end if;

  set hasil =0;
  if x = 1 then
	set hasil = gapok * (50/100);
  elseif x >= 2 then
	set hasil = gapok;
  elseif x <= 0 then
	set hasil = 0;
  end if; 

  return hasil;
end
;;
delimiter ;

