-- ----------------------------
-- Procedure structure for updateEmployeeMutation
-- ----------------------------
DROP PROCEDURE IF EXISTS `updateEmployeeMutation`;
delimiter ;;
CREATE PROCEDURE `updateEmployeeMutation`(eid int)
begin
update m_employee a,
( select * from m_employee_mutation where employee_id = eid order by tdate desc limit 1 ) b
set a.division_id = b.division_id,
a.department_id = b.department_id,
a.unit_id = b.unit_id,
a.workarea_id = b.workarea_id,
a.position_id = b.position_id,
a.grade_id = b.grade_id,
a.employeestatus_id = b.employeestatus_id
where a.employee_id = eid and a.employee_id = b.employee_id;
end
;;
