-- ----------------------------
-- Triggers structure for table t_attendance
-- ----------------------------
DROP TRIGGER IF EXISTS `before_insert_t_attendance`;
delimiter ;;
CREATE TRIGGER `before_insert_t_attendance` BEFORE INSERT ON `t_attendance` FOR EACH ROW BEGIN  
    DECLARE emp_nip VARCHAR(255);  
		DECLARE emp_name VARCHAR(255);  
    DECLARE emp_employee_id INT;  
    DECLARE emp_company_id INT;  
    DECLARE emp_department_id INT;  
    DECLARE emp_position_id INT;  
    DECLARE emp_employeestatus_id INT;  
  
    -- Mengambil data dari m_employee berdasarkan fingerid  
    SELECT nip, name, employee_id, company_id, department_id, position_id, employeestatus_id  
    INTO emp_nip, emp_name, emp_employee_id, emp_company_id, emp_department_id, emp_position_id, emp_employeestatus_id  
    FROM m_employee  
    WHERE fingerid = NEW.fingerid;  
  
    -- Mengatur nilai kolom di t_attendance  
    SET NEW.nip = emp_nip;  
		SET NEW.name = emp_name;
    SET NEW.employee_id = emp_employee_id;  
    SET NEW.company_id = emp_company_id;  
    SET NEW.department_id = emp_department_id;  
    SET NEW.position_id = emp_position_id;  
    SET NEW.employeestatus_id = emp_employeestatus_id;  
  
    -- Menghitung lateminutes  
    IF NEW.timein IS NOT NULL AND NEW.shiftin IS NOT NULL THEN  
        IF NEW.timein > NEW.shiftin THEN  
            SET NEW.lateminutes = TIMESTAMPDIFF(MINUTE, NEW.shiftin, NEW.timein);  
        ELSE  
            SET NEW.lateminutes = 0;  
        END IF;  
    ELSE  
        SET NEW.lateminutes = 0; -- Jika timein atau shiftin NULL  
    END IF;  
  
    -- Menghitung earlyoutminutes  
    IF NEW.timeout IS NOT NULL AND NEW.shiftout IS NOT NULL THEN  
        IF NEW.timeout < NEW.shiftout THEN  
            SET NEW.earlyoutminutes = TIMESTAMPDIFF(MINUTE, NEW.timeout, NEW.shiftout);  
        ELSE  
            SET NEW.earlyoutminutes = 0;  
        END IF;  
    ELSE  
        SET NEW.earlyoutminutes = 0; -- Jika timeout atau shiftout NULL  
    END IF;  
END
;;
delimiter ;

